SELECT AVG("supplier"."s_suppkey") as agg_0, MIN("supplier"."s_suppkey") as agg_1, COUNT(*) as agg_2 FROM "supplier"  WHERE "supplier"."s_suppkey" BETWEEN 542 AND 916 AND "supplier"."s_phone" IN ('28-759-469-3026', '21-461-965-6279', '27-989-741-2988', '14-586-922-9066', '12-833-374-9658') AND "supplier"."s_nation" NOT LIKE '%BRA%ZIL%' AND ("supplier"."s_nation" IN ('CHINA') OR "supplier"."s_nation" IN ('FRANCE', 'EGYPT'))